import React from 'react';
import ReactDOM from 'react-dom';
import Card from './Netflix';

import "./App.css";
import Sdata from './Sdata';

ReactDOM.render(

 <>
    <h1 className="heading-1">Top 6 Netflix Series</h1>

    <Card
       imgsrc={Sdata[0].imgsrc}
       title={Sdata[0].title}
       sname={Sdata[0].sname}
       link={Sdata[0].link}
    />

 </>
  ,
  document.getElementById('root')
);
